import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'
import './Styles/Home.css'
function Home()
{
    useEffect(()=>{
        AOS.init({
            duration:2000,
        })
    },[])
    return(
        <div >
            <div id="carouselExampleControls" class="carousel slide" data-bs-ride="carousel">
 
  <p>Gallery</p>
 <div className="row ">
  <div className="col-sm-4 ">
  <div className="bg-danger a">1</div>
  </div>
  <div className="col-sm-4  "><div className="bg-danger "><img className="a" src="./images/a.jpg" height="250px" width="350px"/></div></div>
  <div className="col-sm-4  "><div className="bg-danger a">1</div></div>
 </div>
 <div className="row ">
  <div className="col-sm-4 "><div className="bg-danger a">1</div></div>
  <div className="col-sm-4 "><div className="bg-danger a">1</div></div>
  <div className="col-sm-4 "><div className="bg-danger a">1</div></div>
 </div>
</div>

 


</div>

         
    )
}
export default Home;
